<script setup lang="ts">
import anime from 'animejs'
const animatePaths = (
  paths: Array<HTMLElement>,
  totalDuration: number,
  fillDuration = 500
) => {
  anime
    .timeline()
    .add({
      targets: paths,
      strokeDashoffset: [anime.setDashoffset, 0],
      easing: 'easeInOutSine',
      duration: 400,
      delay: (_, i) => (i * totalDuration) / paths.length,
    })
    .add({
      targets: paths,
      fill: ['rgba(0,0,0,0)', 'rgba(255, 255, 255, 0.87)'],
      duration: 300,
      delay: (_, i) => (i * fillDuration) / paths.length,
      easing: 'linear',
    })
}
const planningSvg = ref()
const pokerSvg = ref()
const props = defineProps({
  animationDuration: {
    type: Number,
    default: 1000,
  },
})

onMounted(() => {
  const planningPaths = planningSvg.value.querySelectorAll('path')
  animatePaths(planningPaths, props.animationDuration)
  const pokerPaths = pokerSvg.value.querySelectorAll('path')
  animatePaths(pokerPaths, props.animationDuration)
})
</script>

